description:
Richard Branson: Life at 30,000 feet

Richard Branson talks to TED&amp;#039;s Chris Anderson about the ups and the downs of his 

career, from his multibillionaire success to his multiple near-death experiences 

and reveals some of his (very surprising) motivations.

Richard Branson bootstrapped his way from record-shop owner to head of the Virgin 

empire. 

Now he&amp;#039;s focusing his boundless energy on saving our environment.


